import React from 'react';
import { Link } from 'react-router-dom';
import ProductCard from './ProductCard';
import './ProductListing.css';
import image1 from '../images/image1.jpg';

const ProductListing = () => {
 const products = [
  {
    id: 1,
    name: 'Luminous GPTTEX 240 AH',
    image: image1,
    price: 49.99
   },
   {
    id: 2,
    name: '24v Deep Cycle Battery',
    image: image1,
    price: 69.99
   },
   {
    id: 3,
    name: '60Ah 12v Battery',
    image: image1,
    price: 54.99
   },
   {
    id: 4,
    name: '120Ah 24v Battery',
    image: image1,
    price: 99.99
   },
   {
    id: 5,
    name: '50Ah 12v Battery',
    image: image1,
    price: 42.99
   },
   {
    id: 6,
    name: '100Ah 24v Battery',
    image: image1,
    price: 79.99
   },
 ];



 return (
  <div className="main">
    <header>
      <div className="left">Batteries</div>
      <div className="right">View All Batteries</div>
    </header>
    <div className="product-listing">
      {products.map((product) => (
        <Link className="link" key={product.id} to={`/product/${product.id}`}>
          <ProductCard product={product} />
        </Link>
      ))}
    </div>
  </div>
 );
};

export default ProductListing;
